import {
  address,
} from './address';
import {
  normalizeURL,
} from './funcs';

export const ABOUT = '/about';
export const LANDING = '/';
export const PRIVACY = '/privacy';
export const TERMS = '/terms';
export const JOBS = '/jobs';
export const CREATE = '/create';
export const PROFILES = '/profiles';

export const PROFILE = `/${normalizeURL(address)}/activity`;
export const PROFILE_ACTIVITY = `/${normalizeURL(address)}/activity`;
export const PROFILE_ABOUT = `/${normalizeURL(address)}/about`;
export const PROFILE_EDIT = `/${normalizeURL(address)}/edit`;

export const PUBLIC_PROFILE = '/:ethaddress';
export const PUBLIC_ACTIVITY_ROUTE = '/activity';
export const PUBLIC_DETAILS_ROUTE = '/details';
